import './styles/App.css';
import FeedContent from './FeedContent';
import Header from './Header';
import {Switch, Route, BroserRouter} from "react-router-dom"

function App() {
  const api_url = process.env.REACT_APP_API_URL;
  const api_key = process.env.REACT_APP_API_KEY; // пока не юзаем, но выглядит круто
  const post_fetch_amount = 100;
  const fetch_url = api_url + "posts/?amount=" + post_fetch_amount;
  console.log(fetch_url)
  return (
    <>
    <BrowserRouter>
      <Header></Header>
      <Switch>
        <Route exact path="/">
          <FeedContent api_url={fetch_url}></FeedContent>
        </Route>
      </Switch>
    </BrowserRouter>
    </>
  );
}

export default App;
